import { EgretLoadable } from "egret";
import ConstantList from "../../appConfig";
import { useTranslation, withTranslation, Trans } from "react-i18next";
const Employeess = EgretLoadable({
  loader: () => import("./Employeess"),
});
const ViewComponent = withTranslation()(Employeess);

const EmployeessRoutes = [
  {
    path: ConstantList.ROOT_PATH + "Employeess_manager/Employeess",
    exact: true,
    component: ViewComponent,
  },
];

export default EmployeessRoutes;
